import React from "react";
import Inventory from "../../Data/inventory.json";
import Footer from "../Footer";

export default function ProductList() {
  {
    const imgs = Inventory.map(({ images }) => images);
    {
      return <div>{imgs.front}</div>;
    }
  }
}
